"use strict";(self.webpackChunkrotorflight_docs=self.webpackChunkrotorflight_docs||[]).push([[1546],{2832:t=>{t.exports=JSON.parse('{"blogPosts":[{"id":"/Announcements","metadata":{"permalink":"/announcement/Announcements","source":"@site/announcement/Announcements.md","title":"Announcements","description":"This snapshot is not suitable for end-users. It is intended for beta-testers. Please realise that this software is under heavy development and as such there may be bugs or unintended control issues. Please test with care","date":"2023-09-27T12:18:36.000Z","formattedDate":"September 27, 2023","tags":[],"readingTime":0.27,"hasTruncateMarker":false,"authors":[],"frontMatter":{},"nextItem":{"title":"configurator snapshot 2.0.0-20230702","permalink":"/announcement/configurator snapshot 2.0.0-20230702"}},"content":":::danger\\n This snapshot is not suitable for end-users. It is intended for beta-testers. Please realise that this software is under heavy development and as such there may be bugs or unintended control issues. Please test with care\\n\\n If you wish to become involved in testing these snapshots please contact us on the [Discord](https://discord.gg/6QUySXdEvd) \\n:::"},{"id":"/configurator snapshot 2.0.0-20230702","metadata":{"permalink":"/announcement/configurator snapshot 2.0.0-20230702","source":"@site/announcement/configurator snapshot 2.0.0-20230702.md","title":"configurator snapshot 2.0.0-20230702","description":"Rotorflight Configurator snapshot 2.0.0-20230702 is ready","date":"2023-09-27T12:18:36.000Z","formattedDate":"September 27, 2023","tags":[],"readingTime":0.345,"hasTruncateMarker":false,"authors":[{"name":"Rotorflight","image_url":"https://github.com/rotorflight.png","imageURL":"https://github.com/rotorflight.png"}],"frontMatter":{"title":"configurator snapshot 2.0.0-20230702","authors":{"name":"Rotorflight","image_url":"https://github.com/rotorflight.png","imageURL":"https://github.com/rotorflight.png"}},"prevItem":{"title":"Announcements","permalink":"/announcement/Announcements"},"nextItem":{"title":"snapshot 2.0.0-20230401","permalink":"/announcement/snapshot 2.0.0-20230401"}},"content":"Rotorflight Configurator snapshot 2.0.0-20230702 is ready\\nNOTE! This is a HOTFIX for the Configurator. Please use the other components from the 20230628 snapshot.\\n\\n* The Configurator is available to download [here](https://github.com/rotorflight/rotorflight-configurator/releases/tag/snapshot%2F2.0.0-20230702).\\n\\nPlease also read the Snapshots Wiki page for general information about snapshots.\\n\\nChanges to the Configurator:\\n* Receiver tab channel mixup fixed\\n* Failsafe tab channel order fixed\\n* Rates tab collective update fixed\\n* Missing translations fixed"},{"id":"/snapshot 2.0.0-20230401","metadata":{"permalink":"/announcement/snapshot 2.0.0-20230401","source":"@site/announcement/snapshot 2.0.0-20230401.md","title":"snapshot 2.0.0-20230401","description":"Rotorflight snapshot 2.0.0-20230401 is ready","date":"2023-09-27T12:18:36.000Z","formattedDate":"September 27, 2023","tags":[],"readingTime":0.595,"hasTruncateMarker":false,"authors":[{"name":"Rotorflight","image_url":"https://github.com/rotorflight.png","imageURL":"https://github.com/rotorflight.png"}],"frontMatter":{"title":"snapshot 2.0.0-20230401","authors":{"name":"Rotorflight","image_url":"https://github.com/rotorflight.png","imageURL":"https://github.com/rotorflight.png"}},"prevItem":{"title":"configurator snapshot 2.0.0-20230702","permalink":"/announcement/configurator snapshot 2.0.0-20230702"},"nextItem":{"title":"snapshot 2.0.0-20230417","permalink":"/announcement/snapshot 2.0.0-20230417"}},"content":"Rotorflight snapshot 2.0.0-20230401 is ready\\nNOTE! This is the first public snapshot of Rotorflight-2.\\n\\n* The Configurator is available to download [here](https://github.com/rotorflight/rotorflight-configurator/releases/tag/snapshot%2F2.0.0-20230401).\\n* The Blackbox is available to download [here](https://github.com/rotorflight/rotorflight-blackbox/releases/tag/snapshot%2F2.0.0-20230401).\\n* The LUA scripts is available to download [here](https://github.com/rotorflight/rotorflight-lua-scripts/releases/tag/snapshot%2F2.0.0-20230401).\\n\\nPlease also read the Snapshots Wiki page for general information about snapshots.\\n\\nLots of development time has gone into Rotorflight-2 (RF2). Most features in the firmware have been rewritten, with the knowledge learned from Rotorflight-1. The firmware has been upgraded to the BF4.3 level. Numerous issues have been fixed.\\n\\nThe development is continuing strong. The firmware is now receiving only minor updates, but the Configurator and Blackbox development is gaining speed.\\n\\nNew snapshots should arrive biweekly or so.\\n\\nHappy flying!"},{"id":"/snapshot 2.0.0-20230417","metadata":{"permalink":"/announcement/snapshot 2.0.0-20230417","source":"@site/announcement/snapshot 2.0.0-20230417.md","title":"snapshot 2.0.0-20230417","description":"Rotorflight snapshot 2.0.0-20230417 is ready","date":"2023-09-27T12:18:36.000Z","formattedDate":"September 27, 2023","tags":[],"readingTime":0.96,"hasTruncateMarker":false,"authors":[{"name":"Rotorflight","image_url":"https://github.com/rotorflight.png","imageURL":"https://github.com/rotorflight.png"}],"frontMatter":{"title":"snapshot 2.0.0-20230417","authors":{"name":"Rotorflight","image_url":"https://github.com/rotorflight.png","imageURL":"https://github.com/rotorflight.png"}},"prevItem":{"title":"snapshot 2.0.0-20230401","permalink":"/announcement/snapshot 2.0.0-20230401"},"nextItem":{"title":"snapshot 2.0.0-20230508","permalink":"/announcement/snapshot 2.0.0-20230508"}},"content":"Rotorflight snapshot 2.0.0-20230417 is ready\\nNOTE! This snapshot is not suitable for end-users. It is intended for beta-testers.\\n\\n* The Configurator is available to download [here](https://github.com/rotorflight/rotorflight-configurator/releases/tag/snapshot%2F2.0.0-20230417).\\n* The Blackbox is available to download [here](https://github.com/rotorflight/rotorflight-blackbox/releases/tag/snapshot%2F2.0.0-20230417).\\n* The LUA scripts is available to download [here](https://github.com/rotorflight/rotorflight-lua-scripts/releases/tag/snapshot%2F2.0.0-20230510).\\n\\nPlease also read the Snapshots Wiki page for general information about snapshots.\\n\\nChanges to the firmware:\\n* Add throttle command to BlackBox log\\n* Add crsf_flight_mode_reuse parameter\\n* Fix Horizon mode gain\\n* Fix Error Rotation (piro compensation)\\n* Fix MIXER MSP format (trims + swash phase)\\n* Refactor Custom Defaults handling\\n* Refactor Altitude fusion\\n* Simplify PID Mode#2\\n* Improve PID parameter defaults\\n* Improve Gyro filter parameter defaults\\n\\nChanges to the Configurator:\\n* Fix Receiver tab Model Preview\\n* Add Zoom function on Ctrl-Wheel\\n* Refactor Custom Defaults handling\\n* Fix Blackbox Log field selection\\n* Fix MSP_MIXER_CONFIG parameters\\n* Fix Gyro & PID loop speed calculation\\n\\nChanges to the BlackBox:\\n* Update Flight Mode flags\\n* Update Feature flags\\n* Update Field names\\n* Update Field value presentations\\n* Update enabled fields handling\\n* Remove broken Heading estimation\\n* Clean up whitespace in the code"},{"id":"/snapshot 2.0.0-20230508","metadata":{"permalink":"/announcement/snapshot 2.0.0-20230508","source":"@site/announcement/snapshot 2.0.0-20230508.md","title":"snapshot 2.0.0-20230508","description":"Rotorflight snapshot 2.0.0-20230508 is ready","date":"2023-09-27T12:18:36.000Z","formattedDate":"September 27, 2023","tags":[],"readingTime":0.7,"hasTruncateMarker":false,"authors":[{"name":"Rotorflight","image_url":"https://github.com/rotorflight.png","imageURL":"https://github.com/rotorflight.png"}],"frontMatter":{"title":"snapshot 2.0.0-20230508","authors":{"name":"Rotorflight","image_url":"https://github.com/rotorflight.png","imageURL":"https://github.com/rotorflight.png"}},"prevItem":{"title":"snapshot 2.0.0-20230417","permalink":"/announcement/snapshot 2.0.0-20230417"},"nextItem":{"title":"snapshot 2.0.0-20230602","permalink":"/announcement/snapshot 2.0.0-20230602"}},"content":"Rotorflight snapshot 2.0.0-20230508 is ready\\nNOTE! This snapshot is not suitable for end-users. It is intended for beta-testers.\\n\\n* The Configurator is available to download [here](https://github.com/rotorflight/rotorflight-configurator/releases/tag/snapshot%2F2.0.0-20230508).\\n* The Blackbox is available to download [here](https://github.com/rotorflight/rotorflight-blackbox/releases/tag/snapshot%2F2.0.0-20230508).\\n* The LUA scripts is available to download [here](https://github.com/rotorflight/rotorflight-lua-scripts/releases/tag/snapshot%2F2.0.0-20230510).\\n\\nPlease also read the Snapshots Wiki page for general information about snapshots.\\n\\nChanges to the firmware:\\n* CRSF Flight Mode reuse fixed (system lockup with ELRS)\\n* Governor Mode1 fixed without Voltage sensor\\n* Filter stack refactored\\n* PID loop saturation fixed\\n* CPU and System Load fixed\\n* BlackBox header improvements\\n* DEBUG log improvements\\n* ARM status LED indication improvements\\n\\nChanges to the Configurator:\\n* Filtering setup refactored\\n* System and CPU Load fixed\\n* Beeper flags fixed\\n\\nChanges to the BlackBox:\\n* Add missing Debug in in \'Add Graph\'\\n* Fix gyro graph scaling"},{"id":"/snapshot 2.0.0-20230602","metadata":{"permalink":"/announcement/snapshot 2.0.0-20230602","source":"@site/announcement/snapshot 2.0.0-20230602.md","title":"snapshot 2.0.0-20230602","description":"Rotorflight snapshot 2.0.0-20230602 is ready","date":"2023-09-27T12:18:36.000Z","formattedDate":"September 27, 2023","tags":[],"readingTime":0.91,"hasTruncateMarker":false,"authors":[{"name":"Rotorflight","image_url":"https://github.com/rotorflight.png","imageURL":"https://github.com/rotorflight.png"}],"frontMatter":{"title":"snapshot 2.0.0-20230602","authors":{"name":"Rotorflight","image_url":"https://github.com/rotorflight.png","imageURL":"https://github.com/rotorflight.png"}},"prevItem":{"title":"snapshot 2.0.0-20230508","permalink":"/announcement/snapshot 2.0.0-20230508"},"nextItem":{"title":"snapshot 2.0.0-20230628","permalink":"/announcement/snapshot 2.0.0-20230628"}},"content":"Rotorflight snapshot 2.0.0-20230602 is ready\\nNOTE! This snapshot is not suitable for end-users. It is intended for beta-testers.\\n\\n* The Configurator is available to download [here](https://github.com/rotorflight/rotorflight-configurator/releases/tag/snapshot%2F2.0.0-20230602).\\n* The Blackbox is available to download [here](https://github.com/rotorflight/rotorflight-blackbox/releases/tag/snapshot%2F2.0.0-20230602).\\n* The LUA scripts is available to download [here](https://github.com/rotorflight/rotorflight-lua-scripts/releases/tag/snapshot%2F2.0.0-20230602).\\n\\nPlease also read the Snapshots Wiki page for general information about snapshots.\\n\\nChanges to the firmware:\\n* RPM filter refactored\\n* ESC telemetry refactored\\n* Gyro filter config sanity checks added\\n* motor_rpm_lpf default changed to 100Hz\\n* fterm_filter removed in PID mode 9\\n* pid_dterm_mode and pid_dterm_mode_yaw enabled\\n* debug_axis parameter changed to an integer value\\n* led CLI command fixed to be backwards compatible\\n* SPI ELRS binding bugfix cherry-picked\\n\\nChanges to the Configurator:\\n* Refactor RPM filter support\\n* Fix filter config corruption\\n* Fix debug axis values\\n* Fix debug mode names\\n* Reorganise tabs\\n\\nChanges to the Blackbox:\\n* Win32 build added\\n* More Debug field fixes\\n\\nChanges to the LUA Scripts:\\n* PID Error limits fixed\\n* Rate selection fixed\\n* Better labels fox small screens\\n* Filter config aligned with the firmware"},{"id":"/snapshot 2.0.0-20230628","metadata":{"permalink":"/announcement/snapshot 2.0.0-20230628","source":"@site/announcement/snapshot 2.0.0-20230628.md","title":"snapshot 2.0.0-20230628","description":"Rotorflight snapshot 2.0.0-20230628 is ready","date":"2023-09-27T12:18:36.000Z","formattedDate":"September 27, 2023","tags":[],"readingTime":1.05,"hasTruncateMarker":false,"authors":[{"name":"Rotorflight","image_url":"https://github.com/rotorflight.png","imageURL":"https://github.com/rotorflight.png"}],"frontMatter":{"title":"snapshot 2.0.0-20230628","authors":{"name":"Rotorflight","image_url":"https://github.com/rotorflight.png","imageURL":"https://github.com/rotorflight.png"}},"prevItem":{"title":"snapshot 2.0.0-20230602","permalink":"/announcement/snapshot 2.0.0-20230602"},"nextItem":{"title":"snapshot 2.0.0-20230724","permalink":"/announcement/snapshot 2.0.0-20230724"}},"content":"Rotorflight snapshot 2.0.0-20230628 is ready\\nNOTE! This snapshot is not suitable for end-users. It is intended for beta-testers.\\n\\n* The Configurator is available to download [here](https://github.com/rotorflight/rotorflight-configurator/releases/tag/snapshot%2F2.0.0-20230628).\\n* The Blackbox is available to download [here](https://github.com/rotorflight/rotorflight-blackbox/releases/tag/snapshot%2F2.0.0-20230628).\\n* The LUA scripts is available to download [here](https://github.com/rotorflight/rotorflight-lua-scripts/releases/tag/snapshot%2F2.0.0-20230628).\\n\\nPlease also read the Snapshots Wiki page for general information about snapshots.\\n\\nChanges to the firmware:\\n* Servo twitch at reboot fixed\\n* OMP Hobby ESC telemetry protocol added\\n* HobbyWing ESC telemetry fixed\\n* ESC telemetry debug refactored\\n* ESC telemetry stream collection support added\\n* BLACKBOX_ERASE mode fixed\\n* Error decay (I-term decay) parameter added for cyclic and yaw\\n* Collective to Yaw precompensation refactored\\n* Unsynced motor update rate limits refactored\\n* MSP message fixes\\n\\nChanges to the Configurator:\\n* Rates Smoothness added to Rates tab\\n* Collective added to Rates tab\\n* ESC Debug modes fixed\\n* ESC sensor fixed in Power tab\\n* Receiver tab and support refactored\\n* Unsynced PWM rate handling fixed\\n* MSP messages aligned with new firmware\\n* Localization disabled until translations done\\n\\nChanges to the Blackbox:\\n* ESC Sensor debug fixed\\n* Custom event types added\\n\\nChanges to the LUA Scripts:\\n* Support for rates smoothness added\\n* Support for error decay added\\n* Filter support fixed"},{"id":"/snapshot 2.0.0-20230724","metadata":{"permalink":"/announcement/snapshot 2.0.0-20230724","source":"@site/announcement/snapshot 2.0.0-20230724.md","title":"snapshot 2.0.0-20230724","description":"Rotorflight snapshot 2.0.0-20230724 is ready","date":"2023-09-27T12:18:36.000Z","formattedDate":"September 27, 2023","tags":[],"readingTime":0.79,"hasTruncateMarker":false,"authors":[{"name":"Rotorflight","image_url":"https://github.com/rotorflight.png","imageURL":"https://github.com/rotorflight.png"}],"frontMatter":{"title":"snapshot 2.0.0-20230724","authors":{"name":"Rotorflight","image_url":"https://github.com/rotorflight.png","imageURL":"https://github.com/rotorflight.png"}},"prevItem":{"title":"snapshot 2.0.0-20230628","permalink":"/announcement/snapshot 2.0.0-20230628"},"nextItem":{"title":"snapshot 2.0.0-20230822","permalink":"/announcement/snapshot 2.0.0-20230822"}},"content":"Rotorflight snapshot 2.0.0-20230724 is ready\\nNOTE! This snapshot is not suitable for end-users. It is intended for beta-testers.\\n\\n* The Configurator is available to download [here](https://github.com/rotorflight/rotorflight-configurator/releases/tag/snapshot%2F2.0.0-20230724).\\n* The LUA scripts is available to download [here](https://github.com/rotorflight/rotorflight-lua-scripts/releases/tag/snapshot%2F2.0.0-20230730).\\n\\nPlease also read the Snapshots Wiki page for general information about snapshots.\\n\\nChanges to the Firmware:\\n* Increase Governer total FF limit to 50%\\n* Fix Rescue MSP_RESCUE_PROFILE message\\n* Fix Rescue max_collective parameter handling\\n* Refactor collective-to-yaw precomp again\\n* Reorganise Adjustment Functions\\n* Fix LED strip and ADC on H7\\n* Change Collective curve (rates) scale\\n* Change PID gain scaling\\n\\nChanges to the Configurator:\\n* Collective Rates fixed\\n* Collective-to-Yaw precomp fixed\\n* Rescue Altitude hold D-gain added\\n* Mixer Override for Yaw extended to -45\xb0..45\xb0\\n* Rx signal validity limits moved back to Failsafe\\n* Rx channel count bug fixed\\n\\nChanges to the LUA scripts:\\n* Profile - Various and Profile - Rescue now work correctly with firmware 20230724"},{"id":"/snapshot 2.0.0-20230822","metadata":{"permalink":"/announcement/snapshot 2.0.0-20230822","source":"@site/announcement/snapshot 2.0.0-20230822.md","title":"snapshot 2.0.0-20230822","description":"Rotorflight snapshot 2.0.0-20230822 is ready","date":"2023-09-27T12:18:36.000Z","formattedDate":"September 27, 2023","tags":[],"readingTime":0.86,"hasTruncateMarker":false,"authors":[{"name":"Rotorflight","image_url":"https://github.com/rotorflight.png","imageURL":"https://github.com/rotorflight.png"}],"frontMatter":{"title":"snapshot 2.0.0-20230822","authors":{"name":"Rotorflight","image_url":"https://github.com/rotorflight.png","imageURL":"https://github.com/rotorflight.png"}},"prevItem":{"title":"snapshot 2.0.0-20230724","permalink":"/announcement/snapshot 2.0.0-20230724"},"nextItem":{"title":"snapshot 2.0.0-20230912","permalink":"/announcement/snapshot 2.0.0-20230912"}},"content":"Rotorflight snapshot 2.0.0-20230822 is ready\\nNOTE! This snapshot is not suitable for end-users. It is intended for beta-testers.\\n\\nNOTE! The locales (language translations) are now ready for translation. From now on, they will be kept up-to-date.\\n\\n* The Configurator is available to download [here](https://github.com/rotorflight/rotorflight-configurator/releases/tag/snapshot%2F2.0.0-20230822).\\n\\nPlease also read the Snapshots Wiki page for general information about snapshots.\\n\\nChanges to the Firmware:\\n* Add linear decay limit to error decay\\n* Add tail_center_trim parameter\\n* Add cyclic servo speed equaliser\\n* Add cyclic crosstalk precomp\\n* Add setpoint boost (B-term)\\n* Fix cyclic limit handling in the mixer\\n* Fix collective rates default from 25\xb0 to 12.5\xb0\\n* Fix PID gain defaults\\n* Remove PID Mode 9\\n\\nChanges to the Configurator:\\n* Locales updated for translation effort\\n* Yaw limits in Mixer extended to 45\xb0\\n* MSP aligned with the firmware\\n\\nChanges to the LUA scripts:\\n* Aligned MSP messages with firmware 20230822\\n* Added stick booster to the Profile - PIDs page.\\n* Added error decay limits to the Profile - Various page"},{"id":"/snapshot 2.0.0-20230912","metadata":{"permalink":"/announcement/snapshot 2.0.0-20230912","source":"@site/announcement/snapshot 2.0.0-20230912.md","title":"snapshot 2.0.0-20230912","description":"Rotorflight snapshot 2.0.0-20230912 is ready","date":"2023-09-27T12:18:36.000Z","formattedDate":"September 27, 2023","tags":[],"readingTime":1.45,"hasTruncateMarker":false,"authors":[{"name":"Rotorflight","image_url":"https://github.com/rotorflight.png","imageURL":"https://github.com/rotorflight.png"}],"frontMatter":{"title":"snapshot 2.0.0-20230912","authors":{"name":"Rotorflight","image_url":"https://github.com/rotorflight.png","imageURL":"https://github.com/rotorflight.png"}},"prevItem":{"title":"snapshot 2.0.0-20230822","permalink":"/announcement/snapshot 2.0.0-20230822"}},"content":"Rotorflight snapshot 2.0.0-20230912 is ready\\nNOTE! This snapshot is not suitable for end-users. It is intended for beta-testers.\\n\\n* The Configurator is available to download [here](https://github.com/rotorflight/rotorflight-configurator/releases/tag/snapshot%2F2.0.0-20230912).\\n* The Blackbox is available to download [here](https://github.com/rotorflight/rotorflight-blackbox/releases/tag/snapshot%2F2.0.0-20230912).\\n* The LUA scripts is available to download [here](https://github.com/rotorflight/rotorflight-lua-scripts/releases/tag/snapshot%2F2.0.0-20230912).\\n\\nPlease also read the Snapshots Wiki page for general information about snapshots.\\n\\nChanges to the Firmware:\\n* Governor gov_max_throttle parameter added\\n* Governor tracking_speed fixed in passthrough mode\\n* RPM filter fixed if only main rotor RPM available\\n* RPM filter update fixed for lower CPU load\\n* Cyclic Cross-Coupling refactored\\n* Collective-to-yaw precomp not used during spoolup\\n* TTA Collective correction refactored\\n* TTA not used during spoolup\\n* H7 TIMUP configuration bug fixed\\n* BlackBox multi-file logging fixed (works on W25N01G too)\\n* BlackBox erase refactored - works also while logging\\n* Boost and Offset terms added to BlackBox\\n* PID Test Mode 3 added for HSI testing\\n* Tail center trim scaling changed\\n* Tail motor thrust law changed to linear\\n* Many new parameters added to MSP\\n* Many new parameters added to Adjustment Functions\\n\\nChanges to the Configurator:\\n* Chinese translation added\\n* MSP aligned with the firmware\\n* PID Test Mode 3 added to Profiles\\n* Boost gains and cutoffs added to Profiles\\n* Offset gains and limits added to Profiles\\n* Cyclic Cross-coupling compensation added to Profiles\\n* Governor max throttle added to Profiles\\n* Tail Center Trim added to Mixer\\n\\nChanges to the Blackbox:\\n* Fix a drag&drop bug\\n* Fix adjustment labels\\n* Fix RPM_FILTER debug mode labels\\n* Fix collective setpoint scaling\\n* Changes to the LUA Scripts:\\n\\nAligned MSP messages with firmware 20230912\\nAdded Boost cutoffs\\nAdded Offset gains\\nAdded Cyclic Cross-Coupling\\nAdded Governor Max Throttle"}]}')}}]);